import React, { Fragment } from 'react';
import Head from 'next/head';
import styles from '../styles/home.module.css';

const Home = () => {
    return (
        <Fragment>
            <Head>
                <title>Proyect1</title>
            </Head>
            <div className={styles.container}>
                <h1>Hola</h1>
            </div>
        </Fragment>
    )
}

export default Home;
